import React from 'react'
import styled from 'styled-components';

const BodyContainer = styled.div`
  display:flex;
  height:100vh;
  width:100vw;
  justify-content:center;
  align-items:center;


`
const LefRowContainer = styled.div`
  margin-right:20px;
  width:25%;
`
const RightRowContainer = styled.div`
  display:flex;
  width:25%;
  margin-right:20px;
`
const FeedContainer = styled.div`
  display:flex;
  flex-direction:column;
  width:50%;
  margin-right:20px;
`
const Body = () => {
  return (
    <div>
      <BodyContainer>
        <LefRowContainer>
          <h1>I'm the left row</h1>
        </LefRowContainer>
        <FeedContainer>
          <h1>I'm the feed</h1>
        </FeedContainer>
        <RightRowContainer>
        <h1>I'm the righ row</h1>
        </RightRowContainer>
      </BodyContainer>
    </div>
  )
}

export default Body
